import React from 'react';
import './Home.css';
import bgImg from '../../assets/img/header-min.webp';

function Home() {
    return (
        <main id="main-content">
            <section className="section-home-header content-header">
                <img src={bgImg} alt=""></img>
            </section>
        </main>
    )
}

export default Home;
